function generarPDF() {

  let usuarios = JSON.parse(localStorage.getItem("usuarios"));
  if (usuarios === null) {
    usuarios = [];
  }

  var tableConten = [    
    
    ["Nombre", "CURP", "Teléfono"],
    
    ...usuarios.map((usuario) => [usuario.nombre, usuario.curp, usuario.telefono])
  ];

  const uniqueId = Math.random().toString(6).substring(4, 2) + Math.random().toString(6).substring(4, 2);

  const totalCalculado = productosEnCarrito.reduce((acc, producto) => acc + (producto.precio * producto.cantidad), 0);

  var productos = JSON.parse(localStorage.getItem("productos-en-carrito"));

  var tableContent = [

    ["ID", "Título", "Precio", "Cantidad"],

    ...productos.map((producto) => [producto.id, producto.titulo, producto.precio, producto.cantidad,])
  ];

  var docDefinition = {
    content: [
      { text: "Id: "+ uniqueId, style: "body"},
      { image: 'data:image/jpeg;base64,', width: 150, alignment: 'right' },
      { text: "Cotizacion", style: "header", alignment: 'center' },
      { text: "Usuario registrado", style: "body" },
      { table: { body: tableConten, style: "body" } },
      { text: "Productos en carrito", style: "body"},
      { table: { body: tableContent, style: "body"} },
      { text: "Total: $" + totalCalculado, style: "body" },
      { text: "Términos comerciales:", alignment: 'center', style: "body" },
      { text: "Precios:", style: "body"},
      { ul: [
        ' Nuestro precio es L.A.B. En ubicación de la obra o en oficinas de nuestro cliente en Aguascalientes, Ags.',
        'Esta cotización incluye solo los Ítems de los equipos mencionados.',
        'En caso de cancelaciones en compra de equipos, el cliente deberá pagar un 40% del monto total previa autorización.',
        'En caso de cancelaciones de trabajos mecánicos o externos, el cliente deberá pagar un 45% del monto total previa autorización.'
      ], style: "terminos" },
      { text: "Es muy importante tener la orden de compra y cubiertas las condiciones de pago para que comience a correr el tiempo a partir del siguiente día hábil. SI el material es muy urgente favor de indicarlo por correo y vía telefónica para poder dar opciones de entrega y/o de cobro de flete expres", style: "terminos" }
    ],
    styles: {
      header: {
        fontSize: 15,
        bold: true,
        margin: [0, 0, 0, 10]
      },
      body: {
        fontSize: 12,
        bold: true,
        margin: [0, 8, 0, 8]
      },
      terminos: {
        fontSize: 11,
        bold: false,
        margin: [0, 8, 0, 8]
      }
    }
  };
  
  pdfMake.createPdf(docDefinition).open();
}
  